import React, {Component} from 'react';

class Product extends Component {
	constructor(props) {
		super(props);

		this.state = {'ordered': 0}
	}

	render() {
		return (
			<div className="Product">
				<div>Hi</div>
				<div>{this.state.ordered}</div>
			</div>
		);
	}
}

export default Product;
